import logo from './logo.svg';
import './App.css';
import Component from "./components/component" 
import ComponentLogined from "./components/componentLogined" 
import {Navbar, Nav, NavItem,Brand,Button,NavDropdown,Form,FormControl} from 'react-bootstrap';
import { BrowserRouter as Router, Switch, Route ,Link} from "react-router-dom";


function App() {
  return (
    <div>
      <Router>
          <Route exact path="/" component={Component}/>
          <Route path="/task" component={Component}/>
          <Route path="/login" component={Component}/>
          <Route path="/logined" component={ComponentLogined}/>
      </Router>
    </div>

  );
}

export default App;
